/* eslint-enable */

function clampX (delta) {
  const n = x + delta + 5 * y
  return keypad[n] ? (x + delta) : x
}

function clampY (delta) {
  const n = x + 5 * (y + delta)
  return keypad[n] ? (y + delta) : y
}

function step (dir) {
  if (dir === 'L') x = clampX(-1)
  else if (dir === 'R') x = clampX(1)
  else if (dir === 'U') y = clampY(-1)
  else if (dir === 'D') y = clampY(+1)
  else if (dir === '\n') console.log(num())
  else throw new Error('wat ' + dir)
}

function num () {
  return keypad[x + 5 * y]
}

